  noNewKeys(
    &#x7B;
      a: &#x7B;
        b: "b",
        c: "c",
      &#x7D;,
      x: "y",
    &#x7D;,
    &#x7B;
      a: &#x7B;
        c: "z",
      &#x7D;,
    &#x7D;
  ),
  ["a.b", "x"]
);
